            "content": "Any drugs?"
        },
        {
            "role": "user",
            "content": "No."
        },
        {
            "role": "assistant",
            "content": "And your name, sir?"
        },
        {
            "role": "user",
            "content": "My name is Robert Drabba."
        },
        {
            "role": "assistant",
            "content": "Are there any weapons in the house?"
        },
        {
            "role": "user",
            "content": "I don't know, knives and such. I don't know what she grabbed before she handcuffed me."
        },
        {
            "role": "assistant",
            "content": "What is she doing now, sir?"
        },
        {
            "role": "user",
            "content": "She's biting my arms!"
        },
